import NavBar from '../components/Nav.js'
import styles from '../components/css_modules/Nav.module.css'

function HomePage() {
    return (
        <div>
            <h1 className={styles.heading}>Peter Fulton - Aspiring Full Stack Engineer</h1>
            <NavBar />
        </div>
    )
}

export default HomePage
